import {BrowserRouter as Router,Routes,Route } from "react-router-dom";


import Home from "../views/main/home";
import Shop from "../views/main/shop";
import Service from "../views/main/service";
import Mine from "../views/main/mine";

import City from "../views/enclosure/city";

import ButtomNav from "../components/BottomNav";


const MyRouter = () =>{
    return(
        <>
        <Router>
            
            <Routes>
                <Route path="/city" element={<City/>}></Route>
                <Route path="/" element={<Mine/>}>
                    <Routes>
                    <ButtomNav/>
                        <Route path="/home" element={<Home/>}></Route>
                        <Route path="/shop" element={<Shop/>}></Route>
                        <Route path="/service" element={<Service/>}></Route>
                        <Route path="/mine" element={<Mine/>}></Route> */}
                    </Routes>
                </Route>
                {/* <Route path="/home" element={<Home/>}></Route>
                <Route path="/shop" element={<Shop/>}></Route>
                <Route path="/service" element={<Service/>}></Route>
                <Route path="/mine" element={<Mine/>}></Route> */}
            </Routes>
        </Router>

        </>
    )
}

export default MyRouter
